CREATE TABLE IF NOT EXISTS "simodib_v1_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "simodib_v1_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "simodib_v1_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "simodib_v1_manager" ("user_id" integer NOT NULL PRIMARY KEY REFERENCES "simodib_v1_user" ("id") DEFERRABLE INITIALLY DEFERRED, "email" varchar(500) NOT NULL, "no_hp" varchar(13) NOT NULL, "alamat" text NOT NULL, "created_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "simodib_v1_portalsignup" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "port_kurir" varchar(1) NOT NULL, "port_manager" varchar(1) NOT NULL, "port_admin" varchar(1) NOT NULL);
CREATE TABLE IF NOT EXISTS "simodib_v1_kurir" ("user_id" integer NOT NULL PRIMARY KEY REFERENCES "simodib_v1_user" ("id") DEFERRABLE INITIALLY DEFERRED, "email" varchar(500) NOT NULL, "no_hp" varchar(13) NOT NULL, "alamat" text NOT NULL, "created_date" datetime NOT NULL, "status_akun" varchar(1) NULL);
CREATE TABLE IF NOT EXISTS "simodib_v1_takendistribution" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" datetime NOT NULL, "location" varchar(100) NULL, "distribution_id" integer NOT NULL REFERENCES "simodib_v1_distribution" ("id") DEFERRABLE INITIALLY DEFERRED, "kurir_id" integer NOT NULL REFERENCES "simodib_v1_kurir" ("user_id") DEFERRABLE INITIALLY DEFERRED, "status_antar" varchar(300) NULL, "status" varchar(1) NULL);
CREATE TABLE IF NOT EXISTS "simodib_v1_datalogperjalanan" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" datetime NOT NULL, "x" text NULL, "y" text NULL, "z" text NULL, "status" varchar(10) NULL, "location" text NULL, "taken_distribution_id" integer NOT NULL REFERENCES "simodib_v1_takendistribution" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "simodib_v1_rice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "price" integer NOT NULL, "stock" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "simodib_v1_detailorder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "value" integer NOT NULL, "distribution_id" integer NOT NULL REFERENCES "simodib_v1_distribution" ("id") DEFERRABLE INITIALLY DEFERRED, "rice_id" integer NOT NULL REFERENCES "simodib_v1_rice" ("id") DEFERRABLE INITIALLY DEFERRED, "prices" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "simodib_v1_distribution" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "ordered_by" varchar(255) NOT NULL, "address" text NOT NULL, "statusOrder" varchar(1) NULL);
